import axios from "axios";

export let Id = { id: "" };

export function setId(id: string) {

    Id.id = id;


}

export function getId() {

    return Id;

}

export function allInfoUser() {
    let url = 'http://127.0.0.1:5789/people/';
    url = url + getId().id;
    console.log(url);

    let user = {
        id: getId().id,
        nickname: "",
        password: "",
        username: ""
    }

    axios.get(url)
        .then(response => {
            user = response.data;
            console.log(response.data);
            console.log(user);

        });
    return user;
}
